// src/components/ProfilePopup.js
import "./profilePopup.css";

function ProfilePopup({ onClose, onNavigate }) {
    return (
        <div className="profile-popup" onClick={(e) => e.stopPropagation()}>
            <button onClick={() => onNavigate("/profile")}>My Profile</button>
            <button onClick={() => alert("Order history feature coming soon!")}>Order History</button>
            <button onClick={onClose}>Logout</button>
        </div>
    );
}

export default ProfilePopup;
